  category,
  description,
  amount,
  transactions,
  id,
  setTransactions,
}) {
  //Table to include date/description/category/amount
  return (
    <table>
      <tr>
        <td>{date}</td>
        <td>{description}</td>
        <td>{category}</td>
        <td>{amount}</td>
      </tr>
    </table>
  );
}

